/*basic modules************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************/
import React, { Component } from 'react'

/*const's***********************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************/
const banners = [
    'data:image/webp;base64,',
    'data:image/webp;base64,',
    'data:image/webp;base64,',
]

/*main class***********************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************/
class Banners extends Component {

    /*state***********************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************/
    state = {
        index: 0,
        image: banners[0],
        margin: 'auto',
        width: '100%',
        height: '100%',
        maxheight: '54rem'
    }




    /*life cycle***********************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************/
    componentDidMount() {
        this.scroll = window.setInterval(() => this.onChange(this.state.index += 1), 15000)
    }
    componentWillUnmount() {
        window.clearInterval(this.scroll)
    }




    /*render methods***********************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************/
    renderBanners() {
        return (
            <section style={{ margin: this.state.margin, maxWidth: '126rem', width: this.state.width, height: this.state.height, backgroundSize: 'cover', backgroundPosition: 'bottom right' }}>
                <img style={{ width: this.state.width, height: this.state.height, }} src={this.state.image} alt={`banner_${this.state.index}`} />
            </section>
        )
    }




    /*render***********************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************/
    render() {

        /*return***********************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************/
        return (
            <section style={{ margin: this.state.margin, width: this.state.width, maxheight: this.state.maxheight, height: 'auto' }}>
                {this.renderBanners()}
            </section>
        )
    }




    /*methods***********************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************************/
    onChange = index => {
        var option = (index < 0) ? banners.lenght - 1 : (index >= banners.length) ? 0 : index
        this.setState({ image: banners[option], index: option })
    }

}
export default Banners